import React from 'react';
import Navbar from '../components/Navbar/navbar.component';

import HeroCarousal from '../components/HeroCarousal/HeroCarousal';

//layout variable
const DefaultLayout = (props) => {

  return (

    <>

      <Navbar />

      <HeroCarousal />
      

        {props.children}
    </>
  );


};

export default DefaultLayout;
